branch-defaults:
  dev-mark:
    environment: EB-Docker-Deploy-Master
  dev-siwon:
    environment: EB-Docker-Deploy-Master
  master:
    environment: EB-Docker-Deploy-Master
environment-defaults:
  EB-Docker-Deploy-Master:
    branch: null
    repository: null
global:
  application_name: siwon
  default_ec2_keyname: EB-Docker-Deploy-Keypair
  default_platform: arn:aws:elasticbeanstalk:ap-northeast-2::platform/Docker running
